PREFIX up: <http://purl.uniprot.org/core/>
SELECT DISTINCT ?common_name ?sci_name ?taxon ?taxon_commonname WHERE { 
	?taxon a up:Taxon .
	?taxon up:scientificName ?sci_name .
	?taxon up:rank up:Species .
	?taxon <http://purl.uniprot.org/core/commonName> ?taxon_commonname.
	OPTIONAL { ?taxon up:commonName ?common_name . } 
}

PREFIX up: <http://purl.uniprot.org/core/>
SELECT ?species {
	?species a up:Taxon .}

PREFIX up: <http://purl.uniprot.org/core/>
SELECT ?species ?sci_name ?common_name {
	?species a up:Taxon .
	?species up:scientificName ?sci_name .
	?species up:rank up:Species .
	OPTIONAL { ?species up:commonName ?common_name .}
}
